import Buttin from "./Buttin";
import MultiActionAreaCard from "./Cardtest";
import DialogTest from "./DialogTest";
import Menutest from "./Menutest";
import NavTest from "./NavTest";
import TabbarTest from "./TabbarTest";
import TextFill from "./TextFill";
import Type from "./Type";

function App() {
  return (
    <div className="App">
      <NavTest/><br/><br/><br/><br/>
      <Menutest/>
      <Type/>
      <TabbarTest/>
      <Buttin/>
      <MultiActionAreaCard/>
      <DialogTest/>
      <TextFill/>


    </div>
  );
}

export default App;
